import { Component } from 'react';

export class CardList extends Component {
    render() {
        console.log(this.props);

        return (
            <div>
                {
                monsters.map( (monster, index) => {
                    return (
                        <div key={index}>
                        <h1>{monster.name}</h1>
                        </div>)
                    })
                }
            </div>
        );
    }
};
